模拟call函数如下，需要注意的点

模拟函数必须挂载在Function的原型上
第一个参数如果是null，那么this就指向window

Function.prototype.customizeCall = function (context, ...args) {
    var self = context || window;
    // this即是调用的fn函数
    self.fn = this;
    var result = self.fn(...args);
    // 防止第一个参数为对象时，带上了额外的fn函数
    delete self.fn;
    return result;
};
var a = 0;
var obj = {
