模拟实现new函数如下
new操作符到底干了啥？

创建一个空的简单JavaScript对象（即 {}）；
为步骤1新创建的对象添加属性__proto__，将该属性链接至构造函数的原型对象；
将步骤1新创建的对象作为this的上下文；
如果该函数没有返回对象，则返回this。


__proto__属性其实是废弃了的，请勿使用，也包括生产环境，参见proto
另外，可以看看Object.create，查看详细内容

function Fn(a, b) {
    this.a = a;
    this.b = b;
}
Fn.prototype.c = 3;
Fn.prototype.bar = function (){
    return this.a + this.b + this.c
}
// 自定义new函数，接受参数第一个为调用函数，后面为参数
function customizeNew(constructor, ...args) {
    /*
        这里不推荐这么写
        var obj = {}
        obj.__proto__ = constructor.prototype
        */ 
    var obj = Object.create(constructor.prototype);
    var result = constructor.call(obj, ...args);
    // result执行完如果返回对象就把这个对象返回出去，否则返回
    return result instanceof Object ? result : obj;
}

var res = customizeNew(Fn, 1, 2);
res.a // 1
res.c // 3
res.bar() // 6

